// import logo from './logo.svg';
import './App.css';
import Header from './components/layouts/Header';
import Aboutus from './components/layouts/Aboutsus';
import Contactus from './components/layouts/Contactus';
import Landing from './components/layouts/Landing';
import {Router ,Route} from "react-router-dom";
function App() {
  return (
  <>
<Router>
  <switch>
    <Route path="/" component={Header} exact > <Header/> </Route>
    <Route path="/aboutus" component={Aboutus} exact > <Header/> </Route>
    <Route path="/landing" component={Landing} exact > <Header/> </Route>
    <Route path="/contactus" component={Contactus} exact > <Header/> </Route>
  </switch>
</Router>
  </>
  );
}

export default App;
